import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import AppNavBar from "./components/AppNavbar/AppNavbar";
import Description from "./components/Description/Description";

const App = () => {
  return (
    <div className="App">
      <AppNavBar />
      <Description />
    </div>
  );
};

export default App;
